import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    const name = "Jim";
    return (
      <div className="App">
        <h1>Are You Working</h1>
        <h4>Hello {name}</h4>
      </div>
    );
  }
}
export default App;
